import React from 'react';
import {View, Text} from 'react-native';
import {MotiView} from 'moti';

const AnimatedView = () => {
    return (
    <View>
        <MotiView
        from={{scale: 0.1, opacity: 0.5}}
        animate={{scale: 1, opacity: 1}}
        style={{
        width: 100,
        height: 100,
        borderRadius: 10,
        backgroundColor: 'red',
        }}>
        </MotiView>
        <Text> Hello from another side! </Text>
    </View>
    )
};

export default AnimatedView;
